import React from 'react';

// Tweet component
const Tweet = ({ tweet }) => (
  <div className="tweet">
    <h2>{tweet.username}</h2>
    <p>{tweet.content}</p>
  </div>
);

// Thread component 
const Thread = ({ tweets }) => (
  <div className="thread">
    {tweets.map((tweet) => (
      <Tweet key={tweet.id} tweet={tweet} />
    ))}
  </div>
);

// Usage
// Assuming you have an array of tweets
const tweets = [
  { id: 1, username: 'user1', content: 'This is the first tweet.' },
  { id: 2, username: 'user2', content: 'This is the second tweet.' },
  // more tweets...
];

function App() {
  return (
    <div className="App">
      <Thread tweets={tweets} />
    </div>
  );
}

export default App;
